  return (
    <BrowserRouter>
      <div>
        <div className="App">
          <Nav user={this.state.user}/>
        </div>
            <div className="auth-wrapper">
              <div className="auth-inner">
                <Routes>
                  <Route exact path="/" element={<Home user={this.state.user}/>}/>
